import { Card } from "antd";
const { Meta } = Card;
import React from "react";
import router from "next/router";

const CardProductComponent = (props) => {
    return (
      <Card
        hoverable
        style={{ width: 240 }}
        cover={
          <img
            alt="example"
            src={props.data.image_product}
          />
        }
        className="sp-card"
        onClick={()=>router.push("/page.description")}
      >
        <h3 style={{ color: "black" }}>{props.data.name_product}</h3>
        <h3 style={{ color: "black" }}>{props.data.description_product}</h3>
        <Meta description={"ราคา :"+props.data.price_product} />
      </Card>
    );
  };

  export default CardProductComponent;
